import * as React from "react";
import { ITitleElements } from "../Interfaceses/ITitleElements";
import styles from "../styles/titleList.module.css";
import { TransitionGroup, CSSTransition } from "react-transition-group";

export interface TitleListProps {
  //listElements: ITitleElements;
  //listName: string;
}

export interface TitleListState {
  isActive: Boolean;
}
class TitleList extends React.Component<TitleListProps, TitleListState> {
  state = {
    isActive: false,
  };

  clickHandler = () => {
    let isActive = !this.state.isActive;
    this.setState({ isActive });
  };
  render() {
    //const { listElements, listName } = { ...this.props };
    return (
      <div>
        <div>
          <div className={styles.flexContainer}>
            <div>TestName</div>
            <div
              onClick={() => {
                this.clickHandler();
              }}
            >
              {this.state.isActive ? "Свернуть" : "Развернуть"}
            </div>
          </div>
        </div>
        <div>
          <CSSTransition in={this.state.isActive} timeout={200}>
            <div>
              <ul>
                <li>First Item </li>
                <li>Second Item </li>
                <li>Third Item </li>
              </ul>
            </div>
          </CSSTransition>
        </div>
      </div>
    );
  }
}

export default TitleList;
